import React from 'react';

const Search = () => {
    return (
        <div> 
        <div className='bg-white bg-opacity-25 p-5' style={{margin:"0px 50%"}}>
            <h1 className='text-white fw-bold mt-5 '>F<span className='text-danger'>!</span>nd Knowledge</h1>
        </div>
            <div className="input-group mt-5 pt-5 w-50 mx-auto bg-white bg-opacity-25 p-5 rounded shadow-lg">
                <input type="text" id="search-field"
                    className="form-control bg-dark bg-opacity-50 text-white border border-white rounded border-2 shadow-lg"
                    placeholder="search your book here" aria-label="Recipient's username"
                    aria-describedby="button-addon2"/>
                <button
                    className="btn btn-outline-success ms-2 border border-success rounded border-2" type="button"
                    id="button-addon2">Search</button>
            </div>

        </div>
    );
};

export default Search;
